using Rubin
using Tests
using Elliptic
using HypergeometricFunctions
using Polylogarithms
using SpecialFunctions

@test integrate(x^m*(A+B*x)*(b*x+c*x^2), x) == :(x^(3+m)*(3+m)^-1*(A*c+B*b)+A*b*x^(2+m)*(2+m)^-1+B*c*x^(4+m)*(4+m)^-1)
@test integrate(x^3*(A+B*x)*(b*x+c*x^2), x) == :(1//6*x^6*(A*c+B*b)+1//5*A*b*x^5+1//7*B*c*x^7)
@test integrate(x^2*(A+B*x)*(b*x+c*x^2), x) == :(1//5*x^5*(A*c+B*b)+1//4*A*b*x^4+1//6*B*c*x^6)
@test integrate(x*(A+B*x)*(b*x+c*x^2), x) == :(1//4*x^4*(A*c+B*b)+1//3*A*b*x^3+1//5*B*c*x^5)
@test integrate((A+B*x)*(b*x+c*x^2), x) == :(1//3*x^3*(A*c+B*b)+(1/2)*A*b*x^2+1//4*B*c*x^4)
@test integrate(x^-1*(A+B*x)*(b*x+c*x^2), x) == :((1/2)*x^2*(A*c+B*b)+A*b*x+1//3*B*c*x^3)
@test integrate(x^-2*(A+B*x)*(b*x+c*x^2), x) == :(x*(A*c+B*b)+A*b*log(x)+(1/2)*B*c*x^2)
@test integrate(x^-3*(A+B*x)*(b*x+c*x^2), x) == :((A*c+B*b)*log(x)+B*c*x+-1*A*b*x^-1)
@test integrate(x^-4*(A+B*x)*(b*x+c*x^2), x) == :(-1*x^-1*(A*c+B*b)+B*c*log(x)+-1//2*A*b*x^-2)
@test integrate(x^-5*(A+B*x)*(b*x+c*x^2), x) == :(-1//2*x^-2*(A*c+B*b)+-1*B*c*x^-1+-1//3*A*b*x^-3)
@test integrate(x^-6*(A+B*x)*(b*x+c*x^2), x) == :(-1//3*x^-3*(A*c+B*b)+-1//2*B*c*x^-2+-1//4*A*b*x^-4)
@test integrate(x^-7*(A+B*x)*(b*x+c*x^2), x) == :(-1//4*x^-4*(A*c+B*b)+-1//3*B*c*x^-3+-1//5*A*b*x^-5)
@test integrate(x^-8*(A+B*x)*(b*x+c*x^2), x) == :(-1//5*x^-5*(A*c+B*b)+-1//4*B*c*x^-4+-1//6*A*b*x^-6)
@test integrate(x^m*(b*x+c*x^2)^2*(A+B*x), x) == :(A*b^2*x^(3+m)*(3+m)^-1+B*c^2*x^(6+m)*(6+m)^-1+b*x^(4+m)*(4+m)^-1*(B*b+2*A*c)+c*x^(5+m)*(5+m)^-1*(A*c+2*B*b))
@test integrate(x^3*(b*x+c*x^2)^2*(A+B*x), x) == :(1//6*A*b^2*x^6+1//7*b*x^7*(B*b+2*A*c)+1//8*c*x^8*(A*c+2*B*b)+1//9*B*c^2*x^9)
@test integrate(x^2*(b*x+c*x^2)^2*(A+B*x), x) == :(1//5*A*b^2*x^5+1//6*b*x^6*(B*b+2*A*c)+1//7*c*x^7*(A*c+2*B*b)+1//8*B*c^2*x^8)
@test integrate(x*(b*x+c*x^2)^2*(A+B*x), x) == :(1//4*A*b^2*x^4+1//5*b*x^5*(B*b+2*A*c)+1//6*c*x^6*(A*c+2*B*b)+1//7*B*c^2*x^7)
@test integrate((b*x+c*x^2)^2*(A+B*x), x) == :(1//3*A*b^2*x^3+1//4*b*x^4*(B*b+2*A*c)+1//5*c*x^5*(A*c+2*B*b)+1//6*B*c^2*x^6)
@test integrate(x^-1*(b*x+c*x^2)^2*(A+B*x), x) == :((1/2)*A*b^2*x^2+1//3*b*x^3*(B*b+2*A*c)+1//4*c*x^4*(A*c+2*B*b)+1//5*B*c^2*x^5)
@test integrate(x^-2*(b*x+c*x^2)^2*(A+B*x), x) == :(-1//3*c^-2*(b+c*x)^3*(B*b+-1*A*c)+1//4*B*c^-2*(b+c*x)^4)
@test integrate(x^-3*(b*x+c*x^2)^2*(A+B*x), x) == :(A*b^2*log(x)+b*x*(B*b+2*A*c)+(1/2)*c*x^2*(A*c+2*B*b)+1//3*B*c^2*x^3)
@test integrate(x^-4*(b*x+c*x^2)^2*(A+B*x), x) == :(b*(B*b+2*A*c)*log(x)+c*x*(A*c+2*B*b)+(1/2)*B*c^2*x^2+-1*A*b^2*x^-1)
@test integrate(x^-5*(b*x+c*x^2)^2*(A+B*x), x) == :(B*x*c^2+c*(A*c+2*B*b)*log(x)+-1*b*x^-1*(B*b+2*A*c)+-1//2*A*b^2*x^-2)
@test integrate(x^-6*(b*x+c*x^2)^2*(A+B*x), x) == :(B*c^2*log(x)+-1*c*x^-1*(A*c+2*B*b)+-1//2*b*x^-2*(B*b+2*A*c)+-1//3*A*b^2*x^-3)
@test integrate(x^-7*(b*x+c*x^2)^2*(A+B*x), x) == :(-1*B*c^2*x^-1+-1//2*c*x^-2*(A*c+2*B*b)+-1//3*b*x^-3*(B*b+2*A*c)+-1//4*A*b^2*x^-4)
@test integrate(x^-8*(b*x+c*x^2)^2*(A+B*x), x) == :(-1//2*B*c^2*x^-2+-1//3*c*x^-3*(A*c+2*B*b)+-1//4*b*x^-4*(B*b+2*A*c)+-1//5*A*b^2*x^-5)
