@test integrate(x^3*(b*x+c*x^2)^3*(A+B*x), x) == :(1//7*A*b^3*x^7+1//8*b^2*x^8*(B*b+3*A*c)+1//10*c^2*x^10*(A*c+3*B*b)+1//11*B*c^3*x^11+1//3*b*c*x^9*(A*c+B*b))
@test integrate(x^2*(b*x+c*x^2)^3*(A+B*x), x) == :(1//6*A*b^3*x^6+1//7*b^2*x^7*(B*b+3*A*c)+1//9*c^2*x^9*(A*c+3*B*b)+1//10*B*c^3*x^10+3//8*b*c*x^8*(A*c+B*b))
@test integrate(x*(b*x+c*x^2)^3*(A+B*x), x) == :(1//5*A*b^3*x^5+1//6*b^2*x^6*(B*b+3*A*c)+1//8*c^2*x^8*(A*c+3*B*b)+1//9*B*c^3*x^9+3//7*b*c*x^7*(A*c+B*b))
@test integrate((b*x+c*x^2)^3*(A+B*x), x) == :(1//4*A*b^3*x^4+1//5*b^2*x^5*(B*b+3*A*c)+1//7*c^2*x^7*(A*c+3*B*b)+1//8*B*c^3*x^8+(1/2)*b*c*x^6*(A*c+B*b))
@test integrate(x^-1*(b*x+c*x^2)^3*(A+B*x), x) == :(1//3*A*b^3*x^3+1//4*b^2*x^4*(B*b+3*A*c)+1//6*c^2*x^6*(A*c+3*B*b)+1//7*B*c^3*x^7+3//5*b*c*x^5*(A*c+B*b))
