@test integrate(x^-3*(b*x+c*x^2)^3*(A+B*x), x) == :(-1//4*c^-2*(b+c*x)^4*(B*b+-1*A*c)+1//5*B*c^-2*(b+c*x)^5)
@test integrate(x^-4*(b*x+c*x^2)^3*(A+B*x), x) == :(A*b^3*log(x)+x*b^2*(B*b+3*A*c)+1//3*c^2*x^3*(A*c+3*B*b)+1//4*B*c^3*x^4+3//2*b*c*x^2*(A*c+B*b))
